  const codemapping = {
    "01d": "CLEAR_DAY",
    "01n": "CLEAR_NIGHT",
    "02d": "CLEAR_DAY",
    "02n": "CLEAR_DAY",
    "03d": "CLEAR_DAY",
    "03n": "CLEAR_DAY",
    "04d": "CLEAR_DAY",
    "04n": "CLEAR_DAY",
    "09d": "CLEAR_DAY",
    "09n": "CLEAR_DAY",
    "10d": "CLEAR_DAY",
    "10n": "CLEAR_DAY",
    "11d": "CLEAR_DAY",
    "11n": "CLEAR_DAY",
    "13d": "CLEAR_DAY",
    "13n": "CLEAR_DAY",
    "50n": "CLEAR_DAY",
    "50n": "CLEAR_DAY",
  };
  return (
    <ReactAnimatedWeather
      icon="CLEAR_DAY"
      color="goldenrod"
      size={512}
      animate={true}
    />
  );
}
